import React from "react";

export default function Header() {
  return (
    <header className="fixed top-0 left-0 w-full z-50 bg-black bg-opacity-60 backdrop-blur-md text-white shadow-md">
      <div className="max-w-7xl mx-auto px-4 py-3 flex justify-between items-center">
        <a href="#" className="flex items-center gap-2">
          <img src="/images/logo/logo.png" alt="GrooveTribes Logo" className="h-10 w-auto" />
        </a>
        <nav className="hidden md:flex space-x-6 text-sm font-semibold">
          <a href="#" className="hover:text-pink-400 transition">Home</a>
          <a href="#about" className="hover:text-pink-400 transition">About</a>
          <a href="#contact" className="hover:text-pink-400 transition">Contact</a>
        </nav>
      </div>
    </header>
  );
}
